import { Route, Routes } from 'react-router-dom';
import './App.css';
import Navbar from './components/Navbar/Navbar';
import Home from './components/pages/home/Home';


function App() {
  return (
    <div>
      <Navbar />
      <Routes>
        <Route path='/home' element={<Home />}/>
      </Routes>

    </div>
  );
}

export default App;
